import logo from './logo.svg';
import './App.scss';
import {createBrowserRouter, Link, Outlet, RouterProvider} from "react-router-dom";

const router = createBrowserRouter([
  {
    path: '/',
    element: <Root/>,
    errorElement:<PageError/>,
    children : [
      {
        path: '/',
        element: <div>Accueil <Card></Card><Card></Card><Card></Card>
        <Card></Card><Card></Card><Card></Card></div>
      },
      {
        path: '/fiche-logement',
        element: <div>Fiche logement <h1>igfee</h1></div>
      },
      {
        path: '/a-propos',
        element: <div>A propos</div>
      }
    ]
  },
])

function Card (){
  return <>
    <div class="card">
      <p>Card</p>
    </div>
  </>
}

function PageError(){
  return <>
    <h1>Erreur 404</h1>
  </>
}

function Root (){
  return <>
    <header>
      <Link to="/">Accueil</Link>
      <Link to="/fiche-logement">titre logement</Link>
      <Link to="/a-propos">A propos</Link>
    </header>
    <div className="container">
      <Outlet/>
    </div>
  </>
}

function App() {
  return <RouterProvider router={router}/>
}

export default App;
